INSERT INTO `camp_units` VALUES (1,1,'test','es que me encanta. \r\ntodo madre.\r\nque chido\r\n\r\ny espero que voy a ganar la rifa',NULL,1,'2010-03-26 02:48:14','2010-03-27 19:11:34'),(2,1,'Check UP ','Grandes descuentos para corredores','/campunitpic/0/470_4.jpg',0,'2010-03-27 19:06:49','2010-03-27 19:06:49'),(3,2,'Hospital Sierra Madre','Brindar una atención médica de calidad, con calidez y sentido humano a precios justos es el principal objetivo del HOSPITAL SIERRA MADRE, quien pone a su disposición los servicios de urgencias 24 hrs., estudios de laboratorio, de imagen y radiología diagnóstica, check up\'s, hospitalización, maternidad y servicios de quirófano equipados con tecnología de vanguardia, farmacia, restaurante, y servicio de ambulancia, entre otros.\r\n\r\nAdemás, contamos con un staff de médicos debidamente certificados de todas las especialidades, para brindar un servicio oportuno y de excelente calidad médica. También, ofrecemos paquetes de atención a empresas en check ups ejecutivos y de admisión, membresía Salud Integral de Hopital Sierra Madre para empleados y descuentos preferenciales. ','/campunitpic/0/541_logoHSM.jpg',0,'2010-04-08 04:55:31','2010-04-08 05:01:51');
