INSERT INTO `convocatoriaunits` VALUES (1,'General','El Deportivo Bancario con el aval de la Asociación de Nuevo León invita a sus afiliados y a la comunidad de corredores nacional e internacional a la primera Gran Carrera 5K Bancario.',NULL,1,'2010-02-21 20:32:08','2010-02-21 20:32:08'),(2,'Inscripciónes','Costo: $120 general\r\n       $60 Mujeres 50 y mayores\r\n       $60 Hombres 60 y mayores\r\n\r\nLugares:\r\n- Deportivo Bancario (Km 16.5, Carretera Reynosa, Cd. Benito Juarez)\r\n                                        \r\n- Bajos del Palacio Municipio de 10:00 a 20:00 hrs (Hasta el viernes 5 de Marzo)\r\n                                        \r\n- En las carreras previas hasta el 28 de febrero\r\n                                        \r\n- Parque Niños Heroes, el Sabado 6 de Marzo de 9:00 a 16:00 hrs.\r\n(NO HABRÁ INSCRIPCIONES EN EL DIA DE LA CARRERA)',NULL,1,'2010-02-21 20:40:35','2010-03-01 23:20:12'),(3,'Categorías','- Socios Deportivo Bancario (deberán presentar su credencial vigente)\r\n- 15 a 24\r\n- 25 a 35\r\n- 36 a 45\r\n- 46 a 55\r\n- 55 a mayores',NULL,1,'2010-02-21 20:45:14','2010-02-21 20:45:14'),(4,'Carreras','- Carrera del 1K: Salida a las 8:45 hrs\r\nPara niños de 5 hasta 9 años\r\n\r\n- Carrera del 2K: Salida a las 9:00 hrs\r\nPara niños de 10 hasta 14 años\r\n\r\n- Carrera del 5K: Salida a las 8:00 hrs',NULL,1,'2010-02-21 20:47:47','2010-02-21 20:47:47'),(5,'Premiación','Los tres primeros lugares de ambas ramas:\r\n\r\n1° $1000.-\r\n2° $800.-\r\n3° $500.-',NULL,1,'2010-02-21 21:20:57','2010-02-21 21:20:57'),(6,'Entrega de Paquetes','Sabado el 6 de Marzo de 9:00 a 16:00 hrs en el parque niños heroes.\r\n\r\nLimite de inscripción 1200\r\nSalido del 5K a las 8:00 hrs',NULL,1,'2010-02-21 21:21:50','2010-02-21 21:21:50'),(7,'Inscripciones','Limite de inscripción: 4 de marzo y el sábado 6 de marzo.\r\n\r\nHorarios: Lunes a viernes de 9:00 a 20:00 hrs.\r\n\r\nLugar: Gimnasio del Campus UDEM, en línea en www.idemsport.com ($20 adicionales por servicio) y en las tiendas Innova Sport Plaza Cumbres, Contry, Plaza Fiesta San Agustín, San Nicolás y Plaza San Pedro.\r\n\r\nCupo limitado a 2,500 corredores, en caso de lugares disponibles habrá inscripciones el sábado 6 de marzo en el Gimnasio de la UDEM, de 10:00 a 14:00 y tendrá un costo de $120 pesos.\r\n',NULL,3,'2010-02-23 18:34:13','2010-02-23 18:34:13'),(8,'Categorías 10k','Femenil\r\n15-19 (A), 20-24 (B), 25-29 (C), 30-34 (D), 35-39 (E), 40-44 (F), 45-49 (G) 50+ (H)\r\n\r\nVaronil\r\n15-19 (I), 20-24 (J), 25-29 (K), 30-34 (L), 35-39 (M), 40-44 (N), 45-49 (O) 50+ (H)\r\n',NULL,3,'2010-02-23 18:36:31','2010-02-23 18:36:31'),(9,'Costos','Publico general: $90 pesos.\r\n\r\nComunidad UDEM y 3ra edad: $60 pesos.\r\n\r\nAlumnos de clases cocurriculares deportivas: $30 pesos.\r\n',NULL,3,'2010-02-23 18:37:28','2010-02-23 18:41:57'),(10,'Entrega de números','Fecha: Sábado 6 de marzo.\r\n\r\nLugar: Gimnasio del Campus UDEM\r\n\r\nNota: Los participantes que realizaron su inscripción y pago en otros eventos, favor de presentar su comprobante.\r\n\r\n**El día del evento no se aceptaran pagos ni se hará entrega de números**\r\n\r\n**Persona que no regrese el chip se le hará un cargo de $250 pesos.\r\n',NULL,3,'2010-02-23 18:38:12','2010-02-23 18:42:13'),(11,'Abastecimientos','Ubicados en los kilómetros 2, 4, 6 y 8\r\n',NULL,3,'2010-02-23 18:39:25','2010-02-23 18:42:35'),(12,'Salida','Hora de Salida: 8:00 hrs. en el Gimnasio del Campus UDEM.\r\n',NULL,3,'2010-02-23 18:40:23','2010-02-23 18:42:56'),(13,'Guardarropa y Vestidores','\r\nHabrá servicio de guardarropa en el Gimnasio de la UDEM a partir de las 6:30 hrs., los vestidores y sanitarios se encuentran ubicados dentro del mismo.\r\n',NULL,3,'2010-02-23 18:41:32','2010-02-23 18:41:32'),(14,' Premiación','10K: Se premiará a los primeros  3 lugares generales y por categoría.\r\n**Habrá rifa de premios a todos los participantes**\r\n',NULL,3,'2010-02-23 18:43:29','2010-02-23 18:43:44'),(15,'Resultados','Los resultados serán publicados en la página web oficial de la UDEM: www.udem.edu.mx y en la página  www.idemsport.com.\r\n',NULL,3,'2010-02-23 18:44:32','2010-02-23 18:44:40'),(16,'Carrera','IMPULS con el aval de la Asociación de Atletismo del Estado de Nuevo León, y el apoyo del Municipio de San Pedro, Garza García, convoca a la 4ta. Carrera 10k IMPULS y 3era. etapa del GRAN PREMIO NUEVO LEÓN DE RUTA\r\n',NULL,2,'2010-02-24 16:19:17','2010-02-24 16:33:13'),(17,'Fecha','Domingo 11 de Abril del 2010.\r\nSalida y Meta: Auditorio San Pedro.\r\nHora de salida: 8:00 a.m.\r\nDistancia: 10 Km.\r\nCupo: limitado a 2000 corredores.\r\n',NULL,2,'2010-02-24 16:21:05','2010-02-24 16:21:05'),(18,'Rifa especial','¡ INSCRIBETE YA !\r\ny participa en la rifa de una motocicleta,  a partir del 7 de Febrero y hasta el día 14 de Marzo de 2010\r\n',NULL,2,'2010-02-24 16:22:07','2010-02-24 16:23:01'),(19,'Inscripciones','A partir del 7 de Febrero y hasta el día Sábado10 de Abril de 2010:\r\na) En línea a través de la página: www.idemsport.com\r\nb) En tiendas IMPULS.\r\n•CENTRO: Juan I. Ramón #305 Ote.  entre Galeana y E. Carranza\r\n•ESCOBEDO: Manuel L. Barragán #220 con Sendero, Las Plazas Outlet Mty\r\n•STA. CATARINA: Av. Industriales del Poniente #1050, El Paseo Sta. Catarina.\r\n\r\nc) TIENDAS CHARLY\r\n*PLAZAS OUTLET ESCOBEDO \r\n*SENDERO LINCOLN \r\n*CENTRIKA \r\n*CUMBRES \r\n*SENDERO ESCOBEDO \r\n*SUN MALL GUADALUPE \r\n*CITADEL \r\n*SENDERO APODACA \r\n*GALERÍAS MONTERREY\r\n\r\nd) TIENDAS GNC \r\n*CALZADA DEL VALLE \r\n*CONTRY\r\n\r\ne) TIENDAS PIRMA \r\n*CALZADA MADERO\r\n\r\nf) En todas las carreras previas.\r\n\r\n',NULL,2,'2010-02-24 16:23:32','2010-02-24 16:25:07'),(20,'Costos','ADULTOS: En la tienda $ 120.00,  por Internet $ 140.00\r\n\r\nNIÑOS Y ADULTOS MAYORES: En tienda \r\n$ 60.00,internet $ 80.00 \r\n\r\n*Se consideran adultos mayores : mujeres mayores de 50 y hombres mayores de 60 años.\r\n',NULL,2,'2010-02-24 16:26:35','2010-02-24 16:26:35'),(21,'Categorías ','FEMENIL	   VARONIL\r\n15-19	   15-19\r\n20-24	   20-24\r\n25-29	   25-29\r\n30-34	   30-34\r\n35-39	   35-39\r\n40-44	   40-44\r\n45-49	   45-49\r\n50-54	   50-54\r\n55+	   55-59\r\n	   60-64\r\n	   65+ \r\n',NULL,2,'2010-02-24 16:27:54','2010-02-24 17:03:24'),(22,'Entrega de números','Estacionamiento, Auditorio San Pedro, el Sábado 10 de Abril  de 10:00 a.m. a 4:00 p.m.\r\n\r\nPAQUETE DE COMPETIDOR PARA 10K:\r\n* Camiseta y gorra IMPULS.\r\n* Medalla para todo el corredor inscrito que cruce la meta.\r\n* Hidratación y refrigerio en ruta y meta.\r\n* Derecho a participar en la rifa de un automóvil entre otros premios al entregar el CHIP.\r\n* Seguridad en el recorrido y servicio médico.\r\n* Certificado de resultados por Tiempo Real en la página  www.impuls.com.mx o www.idemsport.com\r\n* El competidor que no recoja su paquete en el lugar, día y horario indicado, perderá TODO derecho derivado de su inscripción.\r\n* Todo participante inscrito cede al Comité Organizador el derecho de utilizar su nombre e imagen en cualquier promoción que \r\nsea motivo de la Cuarta Carrera 10k IMPULS.\r\n* Resultados en video minuto a minuto en: www.idemsport.com\r\n',NULL,2,'2010-02-24 16:29:28','2010-02-24 16:29:28'),(23,'Premios','MÁS DE $200 MIL PESOS EN PREMIOS ¡INSCRÍBETE!\r\n\r\n\r\n•Cada CHIP entregado al finalizar la carrera tendrá derecho a participar \r\nen la rifa de un automóvil Matiz  último modelo entre otros premios.\r\n\r\nPremiación general en efectivo (1ero, 2do y 3er Lugar de cada rama)\r\n1ero. $10,000, 2do. $7,000 y 3er. lugar $3,000.\r\n(De acuerdo a La Federación Mexicana de Atletismo se retendrá el 7% a \r\nlos atletas nacionales y el 14 % a los atletas extranjeros)\r\n\r\nPremiación por categoría (1ero, 2do y 3er Lugar de cada categoría)\r\n1er.  TV 21¨, 2do.  Reloj Cardiovascular y 3er lugar  DVD.\r\n\r\nNOTA: Los ganadores generales no entran en la premiación por categorias.\r\n',NULL,2,'2010-02-24 16:31:28','2010-03-23 04:49:35'),(24,'Inscripciones','\r\nLimite de inscripción: 4 de marzo y el sábado 6 de marzo.\r\n\r\nHorarios: Lunes a viernes de 9:00 a 20:00 hrs.\r\n\r\nLugar: Gimnasio del Campus UDEM, en línea en www.idemsport.com ($20 adicionales por servicio) y en las tiendas Innova Sport Plaza Cumbres, Contry, Plaza Fiesta San Agustín, San Nicolás y Plaza San Pedro.\r\n\r\nCupo limitado a 2,500 corredores, en caso de lugares disponibles habrá inscripciones el sábado 6 de marzo en el Gimnasio de la UDEM, de 10:00 a 14:00 y tendrá un costo de $120 pesos.\r\n',NULL,4,'2010-03-01 23:23:45','2010-03-01 23:23:45'),(25,'Categorías 4 K','Libre Femenil  (T)  y Libre Varonil (S)\r\n',NULL,4,'2010-03-01 23:24:38','2010-03-01 23:24:38'),(26,'Costos','Publico general: $90 pesos.\r\nComunicad UDEM y 3ra edad: $60 pesos.\r\nAlumnos de clases cocurriculares deportivas: $30 pesos.\r\n',NULL,4,'2010-03-01 23:25:23','2010-03-01 23:25:39'),(27,'Entrega de números','Fecha: Sábado 6 de marzo.\r\n\r\nLugar: Gimnasio del Campus UDEM\r\n\r\nNota: Los participantes que realizaron su inscripción y pago en otros eventos, favor de presentar su comprobante.\r\n\r\n**El día del evento no se aceptaran pagos ni se hará entrega de números**\r\n\r\n**Persona que no regrese el chip se le hará un cargo de $250 pesos.\r\n',NULL,4,'2010-03-01 23:26:33','2010-03-01 23:26:33'),(28,'Salida ','Hora de Salida: 8:00 hrs. en el Gimnasio del Campus UDEM.\r\n',NULL,4,'2010-03-01 23:27:36','2010-03-01 23:29:10'),(29,'Premiación','4 K: Se premiará a los primeros  3 lugares generales y por categoría.\r\n\r\n**Habrá rifa de premios a todos los participantes**\r\n',NULL,4,'2010-03-01 23:28:15','2010-03-01 23:28:15'),(30,'Resultados','Los resultados serán publicados en la página web oficial de la UDEM: \r\n\r\nwww.udem.edu.mx y en la página  \r\nwww.idemsport.com.\r\n',NULL,4,'2010-03-01 23:28:48','2010-03-01 23:28:57'),(31,'GENERAL','Fundación amigos VidDa A.C. en coordinación con diversas Instituciones Sociales Y con el aval de la Asociación Estatal de Atletismo; En apoyo a los enfermos de cáncer y sus familias CONVOCAN a todos los atletas, clubes, instituciones y Público en general a participar en la 11 edición de la CARRERA POR LA vidDa 10 K, Carrera Infantil y Caminata Familiar 1.5K',NULL,6,'2010-03-18 20:37:38','2010-03-18 21:09:59'),(32,'LUGAR Y FECHA','Plaza la Purísima, Hidalgo y Serafín Peña en Monterrey, N.L. Domingo 23  de Mayo a las 07:30 hrs',NULL,6,'2010-03-18 20:38:21','2010-03-18 20:39:06'),(33,'INSCRIPCIONES','- FIME UANL (8329-4020 EXT 5728) \r\n\r\n- Bajos del Palacio Municipal de Monterrey. \r\n\r\nEn las sucursales de GNC siguientes:\r\n- Calzada del Valle\r\n- Galerías Monterrey\r\n- HEB Cumbres\r\n- HEB Plaza Contry\r\n- HEB Guadalupe\r\n- HEB San Nicolás \r\n- Soriana Contry\r\n- Soriana San Pedro\r\n- Soriana San Nicolás.\r\n\r\nDONATIVO DE INSCRIPCIONES: $120.00,  INFANTIL $ 50.00\r\n\r\nINSCRIPCION EN LINEA: www.idemsport.com, \r\ncosto: $140.00 pago solo con tarjeta de crédito (solo 10k)\r\n\r\n50% de descuento a hombres mayores de 60 años y mujeres mayores de 50.',NULL,6,'2010-03-18 20:43:38','2010-03-19 16:10:49'),(34,'CATEGORÍAS 10K','VARONIL             \r\n15-19 años         \r\n20-29 años         \r\n30-39 años         \r\n40-49 años         \r\n50-59 años          \r\n60 años o más  \r\n\r\nFEMENIL \r\n15-19 años\r\n20-29 años\r\n30-39 años\r\n40-49 años\r\n50 años o más',NULL,6,'2010-03-18 20:46:48','2010-03-18 21:08:24'),(35,'CATEGORÍAS 1.5K','INFANTIL  Y   CAMINATA FAMILIAR 1.5K\r\nVARONIL              \r\n7-9 años             \r\n10-12 años          \r\n13-14 años         \r\n\r\n\r\nFEMENIL \r\n7-9 años\r\n10-12 años\r\n13-14 años ',NULL,6,'2010-03-18 20:48:35','2010-03-18 21:09:38'),(36,'ENTREGA DE NÚMEROS Y CHIPS','CINTERMEX Salón Oceanía-Antártida,  sábado 22 de Mayo de 10:00 a 17:00 hrs.\r\n\r\nNo se entregaran números el día de la carrera \r\n',NULL,6,'2010-03-18 20:49:43','2010-03-18 20:49:43'),(37,'PREMIACIÓN','Categoría General Varonil\r\n1.- Computadora     \r\n2.- Clima 1 tonelada   \r\n3.- Tel